import CatCard from "./CatCard/CatCard";

const CatParadiseBody = () => {
  function getCatCardList() {
    const { catBreeds } = this.props;
    const catCardList = catBreeds.map((cat) => {
      return <CatCard cat={cat}></CatCard>;
    });
    return catCardList;
  }
  return <div class="cart-cards">{getCatCardList()}</div>;
};

export default CatParadiseBody;
